import React from "react";

const CartPage = ({ cartItems }) => {
  const localItem = localStorage.getItem("cartItems", cartItems);
  const cart = cartItems.map((item) => {
    return (
      <>
        <h1>{localItem.name}</h1>
      </>
    );
  });
  return (
    <>
      <h4>Your Cart</h4>
      {cart}
    </>
  );
};

export default CartPage;
